CREATE SCHEMA dev AUTHORIZATION dbtdev;
ALTER ROLE dbtdev set search_path = 'dev';
GRANT ALL PRIVILEGES ON SCHEMA dev to dbtdev;


BEGIN;
SET client_encoding = 'LATIN1';
SET search_path TO 'dev';
CREATE TABLE details_stg (actif text, valorisation double precision, qte double precision, pu double precision, pru double precision, devise varchar, "type" varchar, date text, day text);
CREATE TABLE rente_stg (action text, dividende double precision, date text, day text);



COMMIT;
ANALYZE details_stg;
ANALYZE rente_stg;


